import React from 'react';
import { setState } from 'react';
import { Link } from 'react-router-dom';
import styles from './Login.module.scss';

export const Login = () => {
    const [email, setEmail] = setState()
    const [pasw, setPasw] = setState()

    const some = (async (em, psw) => {
        const rawResponse = await fetch('https://society-capital.herokuapp.com/api/login', {
            method: 'POST',
            headers: {
                'username': em,
                'password': psw
            }
        })
        const content = rawResponse.json()
        console.log(content)
    })

    return (
        <div className={styles.wrapper}>
            <div className={styles.container}>
                <div className={styles.content}>
                    <div className={styles.text}>
                        Sign in
                    </div>
                    <div className={styles.form}>
                        <input autoComplete='off' placeholder='Email' type='email' value={email} onChange={event => setEmail(event.target.value)}></input>
                        <input autoComplete='off' placeholder='Password' type='password' value={pasw} onChange={event => setPasw(event.target.value)}></input>
                    </div>
                    <button onClick={() => some(email, pasw)}>Submit</button>
                    <hr></hr>
                    <div className={styles.signUp}>
                        Don't have an account?
                        <Link to='signup'><button>Sign up</button></Link>
                    </div>
                    <div className={styles.forgot}>
                        <Link to='/not-found'>Forgot your password?</Link>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Login;
